th_year_day_end = ((JTextField) jTextField_year_ELFNE2.getDateEditor().getUiComponent()).getText();        int counter_places = 0;        int x = jTable_elfne_ELFNE1.getSelectedRow();        //   String month = jTextField_month_ELFNE.getText();        if (x != -1 && m.ob.check_time(month_year_day_end) == true && m.ob.check_time(month_year_day_start) == true) {            model_operations_Elmo7sl.setRowCount(0);                //  String time = m.ob.time_now();            String id_elfne = (String) model_elfne_Elmo7sl.getValueAt(x, 0);            try {                ResultSet rs = m.ob.stmt.executeQuery("select* from el2st where id_elmo7sl=" + id_elfne + " and date between '" + month_year_day_start + "' and '" + month_year_day_end + "'");                while (rs.next()) {                    counter++;                    String serial = rs.getString("serial");                    String id = rs.getString("id");                    String el2st = rs.getString("price");                    String eltok3 = rs.getString("eltok3");                    String date = rs.getString("date");                    model_operations_Elmo7sl.addRow(new Object[]{id, serial, el2st, eltok3, date});                }                String places_elfne = String.valueOf(model_elfne_Elmo7sl.getValueAt(x, 3));                String Real_places_elfne = "'";                String curr = "";                for (int i = 0; i < places_elfne.length(); i++) {                    if (places_elfne.charAt(i) == '-') {                        Real_places_elfne += curr + "','";                        curr = "";                    } else {                        curr += places_elfne.charAt(i);                    }                }                Real_places_elfne += curr + "'";                m.ob.stmt = m.ob.conn.createStatement();                ResultSet rs_places = m.ob.stmt.executeQuery(                        "select (select count(*) from clients_product where date_el2st between " + "'" + month_year_day_start + "' and '" + month_year_day_end + "'" + "  "                        + "and region in (select region from countries where country  in  (" + Real_places_elfne + ") ) ) "                        + "+" + "(select count(*) from el2st s left join clients_product cs on  s.serial=cs.serial "                        + "  where date between " + "'" + month_year_day_start + "' and '" + month_year_day_end + "'" + " and cs."                        + "region in (select region from countries where country  in  (" + Real_places_elfne + ") ) ) as sum"                );                if (rs_places.next()) {                    counter_places = rs_places.getInt(1);                }            } catch (SQLException ex) {                Logger.getLogger(main.class.getName()).log(Level.SEVERE, null, ex);            }            jLabel_TOTAL_Done_el2st.setText(String.valueOf(counter));            jLabel_TOTAL_operation_el2st.setText(String.valueOf(counter_places));        }    }//GEN-LAST:event_jTable_elfne_ELFNE1MouseReleased    private void jTable_operations_ELFNE1MouseReleased(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jTable_operations_ELFNE1MouseReleased        // TODO add your handling code here:    }//GEN-LAST:event_jTable_operations_ELFNE1MouseReleased    private void jTextField1KeyReleased(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_jTextField1KeyReleased        // TODO add your handling code here:        // System.out.println(evt.getKeyCode());        jComboBox_users.showPopup();        if (jComboBox_users.getSelectedIndex() != -1) {            if (evt.getKeyCode() == 127) {                jComboBox_users.removeItemAt(jComboBox_users.getSelectedIndex());                java.io.File f = new java.io.File(directory, "CUSTOMER_SERVICES_USERS.txt");                if (f.exists()) {                    PrintWriter w;                    try {                        w = new PrintWriter(f);